// import { PublicClientApplication } from "@azure/msal-browser";
import { LogLevel } from "@azure/msal-browser";

export const msalConfig = {
  auth: {
    clientId: "caae822c-8c80-4b57-ad15-9fe8759d7e37", 
    authority: "https://login.microsoftonline.com/sethvinit98outlook.onmicrosoft.com", // Replace with your Azure AD Tenant ID
    redirectUri: "http://localhost:3000", 
    postLogoutRedirectUrl: '/',
    navigateToLoginRequestUrl: false,
  },
  cache: {
    cacheLocation: 'localStorage',
    storeAuthStateInCookies: false, // set to 'true' if facing issue in Edge
  },
  system: {
    loggerOptions: {
        loggerCalback: (level, message, containsPii) => {
            if(containsPii){
                return;
            }
            switch (level){
                case LogLevel.Error:
                    console.error(message);
                    return;
                case LogLevel.Info:
                    console.info(message);
                    return;
                case LogLevel.Verbose:
                    console.debug(message);
                    return;
                case LogLevel.Warning:
                    console.warn(message);
                    return;
                default:
                    return;        
            }
        },
    },
  },
};

export const loginRequest = {
    scopes: ['user.read'],
}

